not sure if anyone would find this useful to them, but in my efforts of reversing the live app I managed to get devtools loaded by putting this at the top of cricut-ele-design-space/main.js:
```js
const { app } = require('electron');

app.on('web-contents-created', (event, contents) => {
    contents.once('did-finish-load', () => {
        contents.openDevTools({ mode: 'detach' });
    });
});
```

